  false,\n\t\"url\": null,\n\t\"notes\": \"The following is a summary of mammals observed
  at Fish Springs National Wildlife Refuge, Juab Co., Utah. These observations were
  made during the periods of June 29, thru July 3, July 14-18, and July 21-25, 1958.
